import React, { useState } from 'react';

function CreateProduct() {
  const [name, setName] = useState('Wes');
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          value={name}
          placeholder="Name"
        />
      </label>
    </form>
  );
}

export default CreateProduct;
